from collections import Counter
class Solution:
    def maxOperations(self, nums: list[int], k: int) -> int:
        
        # brute force - 
        maxi = 0
        i = 0
        j = i + 1

        while i < len(nums) and j < len(nums):
            if nums[i] + nums[j] == k:
                nums.pop(i)
                nums.pop(j - 1)
                maxi += 1
                j = i + 1
            else:
                j += 1
                if j == len(nums):
                    i += 1
                    j = i + 1

        return maxi


    def maxOperations2(self, nums: list[int], k: int) -> int:
        maxi = 0
        
        counts = Counter(nums)
        print(counts)

        i = 0
        while i < len(nums):
            if counts[k/2]:
                if counts[k/2] % 2 == 0:
                    maxi = maxi + counts[k/2]/2
                    counts[k/2] = 0
                else:
                    maxi = maxi + int(counts[k/2])
                    counts[k/2] = 1

            if counts[k - nums[i]]:
                print(counts[nums[i]])
                # break
            i += 1
        print(counts)
        return maxi
    


